import React from 'react';
import './App.css';
import nav from './components/navBar/navbar.js';
import {Route,Routes, BrowserRouter as Router} from 'react-router-dom'

function app() {

    return (
      <div>
        <Router>
          <Routes>
            <Route path='/' exact component={nav}/>
          </Routes>
        </Router>


      </div>
    );
}


export default app;
